const {
    Client,
    GatewayIntentBits,
    REST,
    Routes,
    SlashCommandBuilder,
    EmbedBuilder,
    ActionRowBuilder,
    TextInputBuilder,
    ModalBuilder,
    TextInputStyle,
    ButtonBuilder,
    ButtonStyle,
    SelectMenuBuilder,
} = require("discord.js");
const {
    token,
    jailRoleId,
    jailReportChannelId,
    serverid,
    adminRoleId,
} = require("./config.js");
const { JsonDatabase } = require("wio.db");
const db = new JsonDatabase({ databasePath: "DataBase.json" });
const client = new Client({
    intents: [
        GatewayIntentBits.Guilds,
        GatewayIntentBits.GuildMessages,
        GatewayIntentBits.MessageContent,
    ],
});

client.once("ready", async () => {
    console.log(`${client.user.tag} is online!`);

    const commands = [
        new SlashCommandBuilder()
            .setName("jail")
            .setDescription("لـ سـجـن عـضـو")
            .addUserOption((option) => 
                option
                    .setName("user")
                    .setDescription("مـنـشـن الـمـخـالـف")
                    .setRequired(true),
            )
            .toJSON(),
        new SlashCommandBuilder()
            .setName("unjail")
            .setDescription("فـك الـمـخـالـف")
            .addUserOption((option) =>
                option
                    .setName("user")
                    .setDescription("مـنـشـن الـمـخـالـف")
                    .setRequired(true),
            )
            .toJSON(),
        new SlashCommandBuilder()
            .setName("log")
            .setDescription("فـحـص الـمـخـالـف")
            .addUserOption((option) =>
                option
                    .setName("user")
                    .setDescription("مـنـشـن الـمـخـالـف")
                    .setRequired(true),
            )
            .toJSON(),
    ];

    const rest = new REST({ version: "10" }).setToken(token);
    try {
        await rest.put(
            Routes.applicationGuildCommands(client.user.id, serverid),
            { body: commands },
        );
        console.log("Successfully reloaded application (/) commands.");
    } catch (error) {
        console.error("Failed to reload application (/) commands:", error);
    }

    checkJailDuration();
});

client.on("interactionCreate", async (interaction) => {
    if (!interaction.guild) return;

    if (interaction.isChatInputCommand()) {
        const member = await interaction.guild.members.fetch(
            interaction.user.id,
        );

        if (!member.roles.cache.has(adminRoleId)) {
            await interaction.reply({
                content: "You do not have permission to use this command.",
                ephemeral: true,
            });
            return;
        }

        switch (interaction.commandName) {
            case "jail":
                await handleJailCommand(interaction);
                break;
            case "unjail":
                await handleUnjailCommand(interaction);
                break;
            case "log":
                await showJailLogs(interaction);
                break;
            default:
                break;
        }
    } else if (interaction.isModalSubmit()) {
        await handleModalSubmit(interaction);
    } else if (interaction.isButton()) {
        await handleButtonInteraction(interaction);
    }
});

async function handleJailCommand(interaction) {
    const targetUser = interaction.options.getUser("user", true);
    const jailModal = createJailModal();
    await interaction.showModal(jailModal);
    db.set(`jailRequest_${interaction.user.id}`, {
        targetUserId: targetUser.id,
    });
}

async function handleUnjailCommand(interaction) {
    const targetUser = interaction.options.getUser("user", true);
    await restoreUserRolesAndUnjail(
        targetUser.id,
        client.guilds.cache.get(serverid),
        interaction,
    );
}

function createJailModal() {
    return new ModalBuilder()
        .setCustomId("jailModal")
        .setTitle("Jail User")
        .addComponents(
            new ActionRowBuilder().addComponents(
                new TextInputBuilder()
                    .setCustomId("reason")
                    .setLabel("Reason for jail")
                    .setStyle(TextInputStyle.Short)
                    .setMinLength(1)
                    .setMaxLength(100)
                    .setPlaceholder("سـبـب الـمـخـالـف")
                    .setRequired(true),
            ),
            new ActionRowBuilder().addComponents(
                new TextInputBuilder()
                    .setCustomId("time")
                    .setLabel("Time for jail")
                    .setStyle(TextInputStyle.Short)
                    .setMinLength(1)
                    .setMaxLength(10)
                    .setPlaceholder("مـدة الـمـخـالـف 1m 1h 1d")
                    .setRequired(true),
            ),
        );
}

async function logAction(userId, action, reason, jailedBy) {
    const logEntry = {
        action,
        reason,
        by: jailedBy,
        timestamp: Date.now(),
    };
    const userLogs = (await db.get(`logs_${userId}`)) || [];
    userLogs.push(logEntry);
    await db.set(`logs_${userId}`, userLogs);
}

async function handleModalSubmit(interaction) {
    if (interaction.customId !== "jailModal") return;

    const reason = interaction.fields.getTextInputValue("reason");
    const timeInput = interaction.fields.getTextInputValue("time");
    const { targetUserId } = await db.get(`jailRequest_${interaction.user.id}`);
    const duration = parseTimeInput(timeInput);

    if (!duration) {
        await interaction.reply({
            content:
                "Invalid time format. Use 1m for minutes, 1h for hours, or 1d for days.",
            ephemeral: true,
        });
        return;
    }

    await jailUser(interaction, targetUserId, reason, duration);
}

async function jailUser(interaction, targetUserId, reason, duration) {
    const guild = client.guilds.cache.get(serverid);
    const targetMember = await guild.members
        .fetch(targetUserId)
        .catch(console.error);

    await logAction(targetUserId, "Jailed", reason, interaction.user.id);

    if (!targetMember) {
        await interaction.reply({
            content: "Error: User to jail not found.",
            ephemeral: true,
        });
        return;
    }

    const userRoles = targetMember.roles.cache
        .filter((r) => r.id !== guild.roles.everyone.id && r.id !== jailRoleId)
        .map((r) => r.id);

    try {
        await db.set(targetUserId, {
            userId: targetUserId,
            roles: userRoles,
            reason,
            duration: Date.now() + duration,
            jailerId: interaction.user.id,
            timestamp: Date.now(),
        });

        await targetMember.roles.set([jailRoleId]);
        const embed = new EmbedBuilder()
            .setTitle("سـجـل الـمـخـالـف")
            .addFields(
                {
                    name: "الـمـخـالـف",
                    value: targetMember.user.tag,
                    inline: true,
                },
                { name: "سـبـب الـمـخـالـف", value: reason, inline: true },
                {
                    name: "الـمـدة",
                    value: `<t:${Math.floor((Date.now() + duration) / 1000)}:R>`,
                    inline: true,
                },
                {
                    name: "مـسـؤول الـمـخـالـف",
                    value: interaction.user.tag,
                    inline: true,
                },
            )
            .setColor(0xff0000);

        await targetMember
            .send({ content: "You have been jailed", embeds: [embed] })
            .catch((error) =>
                console.error("Could not send DM to jailed user:", error),
            );

        await interaction.reply({ embeds: [embed], ephemeral: true });
        const reportChannel = await client.channels.fetch(jailReportChannelId);
        await reportChannel.send({ embeds: [embed] });
    } catch (error) {
        console.error("Error jailing the user:", error);
        await interaction.reply({
            content: "There was an error trying to jail the user.",
            ephemeral: true,
        });
    }
}

async function restoreUserRolesAndUnjail(userId, guild, interaction = null) {
    const userData = await db.get(userId);
    if (!userData) return;

    const member = await guild.members.fetch(userId).catch(console.error);
    if (!member) return;

    await logAction(
        userId,
        "Unjailed",
        "N/A",
        interaction ? interaction.user.id : "System",
    );
    try {
        await member.roles.set(
            userData.roles.length ? userData.roles : [guild.roles.everyone.id],
        );
        await db.delete(userId);
/// فك المخالف عن العضو 
        const unjailEmbed = new EmbedBuilder()
            .setTitle("فـك الـمـخـالـف")
            .addFields(
                { name: "الـمـخـالـف",
                    value: targetMember.user.tag,
                    inline: true, },
                {
                    name: "الـمـسـؤول",
                    value: interaction
                        ? interaction.user.tag
                        : "Automated Process",
                    inline: true,
                },
                {
                    name: "الـمـده الـمـتـبـقـي",
                    value: `<t:${Math.floor(Date.now() / 1000)}:F>`,
                    inline: false,
                },
            )
            .setColor(0x00ff00);

        await member
            .send({ content: "You have been unjailed", embeds: [unjailEmbed] })
            .catch((error) =>
                console.error("Could not send DM to unjailed user:", error),
            );

        const reportChannel = await client.channels.fetch(jailReportChannelId);
        await reportChannel.send({ embeds: [unjailEmbed] });

        if (interaction) {
            await interaction.reply({
                content: `Successfully unjailed ${member.user.tag} and restored their roles.`,
                ephemeral: true,
            });
        }
    } catch (error) {
        console.error("Error restoring roles to the user:", error);
        if (interaction) {
            await interaction.reply({
                content:
                    "There was an error trying to unjail the user and restore their roles.",
                ephemeral: true,
            });
        }
    }
}

async function showJailLogs(interaction) {
    const user = interaction.options.getUser("user", true);
    const logs = (await db.get(`logs_${user.id}`)) || [];
    const itemsPerPage = 5;
    let page = 0;

    const pages = logs.reduce((acc, log, i) => {
        const pageIndex = Math.floor(i / itemsPerPage);
        if (!acc[pageIndex]) acc[pageIndex] = [];
        acc[pageIndex].push(log);
        return acc;
    }, []);

    const totalPages = pages.length;

    async function updateEmbed(page) {
        const logsForPage = pages[page] || [];
        let description = logsForPage
            .map((log) => {
                const date = new Date(log.timestamp).toLocaleString();
                return `**Action**: ${log.action}\n**Reason**: ${log.reason}\n**By**: ${log.by}\n**Date**: ${date}`;
            })
            .join("\n\n");

        if (!description) description = "No logs available for this user.";

        const embed = new EmbedBuilder()
            .setTitle(
                `Jail Logs for ${user.tag} (Page ${page + 1} of ${totalPages})`,
            )
            .setDescription(description)
            .setColor(0x0099ff);

        const buttons = new ActionRowBuilder().addComponents(
            new ButtonBuilder()
                .setCustomId("previous")
                .setLabel("Previous")
                .setStyle(ButtonStyle.Primary)
                .setDisabled(page === 0),
            new ButtonBuilder()
                .setCustomId("next")
                .setLabel("Next")
                .setStyle(ButtonStyle.Primary)
                .setDisabled(page === totalPages - 1),
        );

        if (interaction.replied || interaction.deferred) {
            await interaction.editReply({
                embeds: [embed],
                components: [buttons],
            });
        } else {
            await interaction.reply({
                embeds: [embed],
                components: [buttons],
                fetchReply: true,
            });
        }
    }

    await updateEmbed(page);

    const filter = (i) =>
        (i.customId === "previous" || i.customId === "next") &&
        i.user.id === interaction.user.id;

    const collector = interaction.channel.createMessageComponentCollector({
        filter,
        time: 60000,
    });

    collector.on("collect", async (i) => {
        if (i.customId === "previous") {
            page = Math.max(page - 1, 0);
        } else if (i.customId === "next") {
            page = Math.min(page + 1, totalPages - 1);
        }
        await i.deferUpdate();
        await updateEmbed(page);
    });

    collector.on("end", (collected) => {
        interaction.editReply({ components: [] });
    });
}

async function handleButtonInteraction(interaction) {}

function parseTimeInput(input) {
    const match = input.match(/^(\d+)([mhd])$/);
    if (!match) return null;

    const value = parseInt(match[1]);
    const unit = match[2];

    switch (unit) {
        case "m":
            return value * 60 * 1000;
        case "h":
            return value * 60 * 60 * 1000;
        case "d":
            return value * 24 * 60 * 60 * 1000;
        default:
            return null;
    }
}

async function checkJailDuration() {
    const guild = client.guilds.cache.get(serverid);
    const allData = await db.all();
    const now = Date.now();

    for (const { ID, data } of allData) {
        if (data && data.duration && data.duration <= now) {
            await restoreUserRolesAndUnjail(ID, guild);
        }
    }

    setTimeout(checkJailDuration, 10000);
}

